import React from "react";
import { Form, Input, InputNumber, Button, message } from "antd";
import { uploadStay } from "../utils";

const layout = {
    labelCol: { span: 8 },
    wrapperCol: { span: 16 },
}
class UploadStay extends React.Component {
    state = {
      loading: false,
    };

    render() {
        // {...layout} spread 语法，把layout这个object里的内容，
        // 一对一对作为key value pair传入form
        // <Form {...layout}></Form> 等价于 <Form lableCol = {} wrapper= {}> </From>

        //name是property的名字，label是在ui上显示的字样
        return <Form
            {...layout}
            name="nest-message"
            style={{maxWidth: 1000, margin: "auto"}}
        >
            <Form.Item name="name"
                       label="Name"
                       rules={[{ required: true }]}>
                <Input />
            </Form.Item>
        </Form>
    }
}
